import React from 'react';
import './Css/TelaStyle.css';
import '../Components/CSS/HeaderStyle.css'
import { Button, Checkbox, Box } from '@material-ui/core';
import TelaDois from './TelaDois';
import EmailTel from '../Components/EmailTel';
import Birthday from '../Components/Birthday';
import {NavigateNextIcon} from '@material-ui/icons/NavigateNext';

function TelaUm() {
    let linkUm = {TelaUm};
    let linkDois = {TelaDois};

    return (
        <div className="background">
            <Box
                sx={{
                    width: 550,
                    height: 750,
                    backgroundColor: 'white',
                    borderRadius: 5,
                    padding: 5,
                }}
                centered
            >
                <header>
                    <h1 className="title">Team Sign Up</h1>
                    <nav className="navegacao">
                        <ul>
                            <li className="active"><a href={linkUm}>Basic</a></li>
                            <li><a href={linkDois}>Social</a></li>
                            <li>Certificates</li>
                        </ul>
                    </nav>
                </header>
                <form action={linkDois}>
                    <label for="nome" className="text" required>Full Name *</label>
                    <input type="text" id="nome" className="inputMax" required placeholder="Jane Doe" />
                    <label for="nickname" className="text">Nickname</label>
                    <input type="text" id="nickname" className="inputMax" placeholder="Mariazinha" />
                    <EmailTel />
                    <Birthday />
                    <Checkbox id="checked" label="I accept the terms and privacy." sx={{ '& .MuiSvgIcon-root': { fontSize: 28 } }} requerid />
                    <label for="checked" className="textCB">I accept the terms and privacy.</label>
                    <Button type="submit" variant="contained" color="primary" width="medium"> 
                        Next
                    </Button>
                </form>
            </Box>
        </div>
    );
}

export default TelaUm;
